import React from 'react';
import './Developers.css';

const Developers = () => {
  return (
    <div className="developers-container">
      <div className="developer-card">
        <img src="./com" alt="Boy Developer" />
        <h2>Gaurav</h2>
        <p>Frontend Developer</p>
      </div>
      <div className="developer-card">
        <img src="https://www.google.com/imgres?q=ai%20images%20girl%20&imgurl=https%3A%2F%2Fxinva.ai%2Fwp-content%2Fuploads%2F2023%2F12%2F121.jpg&imgrefurl=https%3A%2F%2Fxinva.ai%2Fai-girl-generator&docid=2t__I1O6_caKgM&tbnid=QG3VnwAM83hnhM&vet=12ahUKEwih9vDlv9mKAxXEyzgGHcQQEKAQM3oECBUQAA..i&w=1024&h=1024&hcb=2&ved=2ahUKEwih9vDlv9mKAxXEyzgGHcQQEKAQM3oECBUQAA" alt="Girl Developer" />
        <h2>Gaytri</h2>
        <p>Backend Developer</p>
      </div>
    </div>
  );
};

export default Developers;
